import React, { useState } from "react";
import Form from "./components/Form";
// import FilterButton from "./components/FilterButton";
// import Todo from "./components/Todo";
import { 
  FILTER_MAP, FILTER_NAMES, task_filter_list, addTask,
toggleTaskCompleted, deleteTask, editTask, 
ListFiltered, ListOfTasks } from "./components/Main";
import { Detail } from './components/pages/Detail';
import { nanoid } from "nanoid";
import { Routes, Route, Navigate, BrowserRouter, useNavigate } from "react-router-dom";

function App(props) {
[taskList, filterList] = task_filter_list(props)
const tasksNoun = taskList.length !== 1 ? 'tasks' : 'task';
const headingText = `${taskList.length} ${tasksNoun} remaining`;
  return (
    <div className="todoapp stack-large">
      <h1>Todo List</h1>
      <Form addTask={addTask} />
      <ListFiltered filterList={filterList}/>
      <h2 id="list-heading">
        3 tasks remaining
      </h2>
      <ListOfTasks taskList = {taskList}/>
    </div>
  );
}
export default App;
